INSERT INTO `sitesetting` VALUES (1,'عقارات الفوزان','logo.jpg','0598777774','شركة  وطنية سعودية 100 % بلغ عمرها 29 عاماً حققت خلالها العديد من الإنجازات العقارية العملاقة التي أصبحت تعد من الصروح الحضارية الهامة التي يشار اليها بالبنان , إضافة الى تميزها بالمهنية والمصداقية في تنفيذ المشروعات , حيث أكسبتها هذه المميزات ثقة كبيره لدى الوسط العقاري في المملكة . دئماً وابداً سيضل شعارنا الذي يعكس هويتنا هو ... ( استثمر في قلب الصناعة النابض )','A 100% Saudi national company with a history of 29 years in which it has achieved many achievements in real estate giant which has become one of the important architectural monuments referred to as builders, in addition to its excellence in professionalism and credibility in the implementation of projects, which earned these characteristics of great confidence in the real estate sector in the Kingdom. Always, our slogan that reflects our identity is ... (Invest in the heart of the pulsating industry)','شركة وطنية سعودية بلغ عمرها 29','جميع المحتويات على تطبيق عقارات الفوزان  (بما في ذلك على سبيل المثال لا الحصر الكتابات والتصاميم والرسومات والشعارات والأيقونات والصور والمقاطع الصوتية والتحميلات والواجهات والرموز بالإضافة إلى كيفية اختيارها وترتيبها) ملكية حصرية  وتكون هذه الملكية خاضعة لحماية حقوق النشر والعلامة التجارية.','• All content on the application of Al Fozan properties (including, but not limited to, scripts, designs, graphics, logos, icons, images, audio tracks, uploads, interfaces and icons, as well as how they are selected and arranged) is exclusive property and is protected by copyright and trademark.','2018-10-20 13:45:02','2020-03-07 06:54:24');
